import React, { useState, useEffect } from 'react';
import Header from './Header';
import axios from 'axios';

const List = () => {
  const UserList = () => {
    const [users, setUsers] = useState([]);
    const [currentPage, setCurrentPage] = useState(1);
    const [totalPages, setTotalPages] = useState(0);

    // Other component logic...
  }

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get(`/http://localhost:4000/Route/index/userslist?page=${currentPage}`);
        const { users, totalPages } = response.data;
        setUsers(users);
        setTotalPages(totalPages);
      } catch (error) {
        console.error(error);
        // Handle error state
      }
    };

    fetchUsers();
  }, [currentPage]);


  // useEffect(() => {
  //   async function fetchData() {
  //     try {
  //       const res = await axios.get('http://localhost:4000/Route/index/userslist', users);
  //       console.log(res.data);
  //       setUsers(res.data);
  //     } catch (error) {
  //       console.error(error);
  //     }
  //   }
  //   fetchData();
  // }, []);

  // Calculate total number of pages
  const totalPages = Math.ceil(users.length / itemsPerPage);

  // Get the users for the current page
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentUsers = users.slice(indexOfFirstItem, indexOfLastItem);

  // Change page
  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  // Generate page numbers
  const pageNumbers = [];
  for (let i = 1; i <= totalPages; i++) {
    pageNumbers.push(i);
  }

  return (
    <>
      <Header />
      <div className="container mt-5">
        <table className="table table-striped">
          <thead>
            <tr>
              <th scope="col">Id</th>
              <th scope="col">Name</th>
              <th scope="col">Email</th>
              <th scope="col">Hobbies</th>
            </tr>
          </thead>
          <tbody>
            {currentUsers.map((item, index) => {
              return (
                <tr key={index}>
                  <td>{item.id}</td>
                  <td>{item.fname}</td>
                  <td>{item.email}</td>
                  <td>{item.hobbies}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
        <nav>
          <ul className="pagination">
            {pageNumbers.map((pageNumber) => (
              <li key={pageNumber} className="page-item">
                <a
                  href="#"
                  className={`page-link ${pageNumber === currentPage ? 'active' : ''}`}
                  onClick={() => handlePageChange(pageNumber)}
                >
                  {pageNumber}
                </a>
              </li>
            ))}
          </ul>
        </nav>
      </div>
    </>
  );
};

export default List;
